import React from "react";
import styled from "styled-components";
import Header from "../components/Header/Header";

const HomeWrapper = styled.div`
  h2 {
    margin-top: var(--header-height);
  }
`;

const About = () => {
  return (
    <HomeWrapper>
      <h2>우리회사는말이야!</h2>
    </HomeWrapper>
  );
};

export default About;
